import addition, {subtract, multiply, divide} from "./Calc"
function app(){
    return(     
 <>
  <ul>
    <li>{addition(10,5)}</li>
    <li>{subtract(10,5)}</li>
    <li>{multiply(10,5)}</li>
    <li>{divide(10,5)}</li>
  </ul>
   </>
    )
}
export default app;
